class Person extends Component {
    render() {
        return (
            <div>
                <h2>我是person组件</h2>
                <input type="text" placeholder="请输入姓名"/>
                <input type="text" placeholder="请输入年龄"/>
                &nbsp;
                <button>添加</button>
            </div>
        );
    }
}

export default Person;
